//FinanceForm.js
// FinanceForm.js
import React, { useState, useEffect } from 'react';
import { TextField, Button, Typography, Grid, MenuItem } from '@mui/material';
import api from '../api';

const FinanceForm = () => {
  const [amount, setAmount] = useState('');
  const [property, setProperty] = useState('');
  const [properties, setProperties] = useState([]);

  useEffect(() => {
    const fetchProperties = async () => {
      try {
        const response = await api.get('/properties');
        setProperties(response.data);
      } catch (error) {
        console.error('Error al obtener las propiedades:', error);
      }
    };

    fetchProperties();
  }, []);

  const handleSubmit = (event) => {
    event.preventDefault();
    // Aquí puedes implementar la lógica para enviar la solicitud de financiamiento
    console.log('Solicitud de financiamiento:', { amount, property });
  };

  return (
    <form onSubmit={handleSubmit}>
      <Typography variant="h5" gutterBottom>
        Financiar Propiedad
      </Typography>
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <TextField
            label="Cantidad"
            type="number"
            value={amount}
            onChange={(e) => setAmount(e.target.value)}
            fullWidth
            required
          />
        </Grid>
        <Grid item xs={12}>
          <TextField
            select
            label="Propiedad"
            value={property}
            onChange={(e) => setProperty(e.target.value)}
            fullWidth
            required
          >
            {properties.map((prop) => (
              <MenuItem key={prop._id} value={prop._id}>
                {prop.address.fullAddress}
              </MenuItem>
            ))}
          </TextField>
        </Grid>
        <Grid item xs={12}>
          <Button type="submit" variant="contained" fullWidth>
            Solicitar Financiamiento
          </Button>
        </Grid>
      </Grid>
    </form>
  );
};

export default FinanceForm;
